      SELECT DISTINCT col0 * + - ( col0 ) AS col2 FROM tab1 (FORMAT parquet) cor0 WHERE NULL NOT BETWEEN - 50 + - + 31 AND ( - 23 + + col1 );
  - name: tab1

outputs:
  - name: q11560.out
    data: |
